import React, {useState} from "react";
import {Navigate, useLocation} from "react-router-dom";
import {Button, Grid, ToggleButton, ToggleButtonGroup, Typography} from "@mui/material";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import {CssTextField, ReadOnlyTextField} from "../Utils/CustomTextFields";
import ListItemButton from "@mui/material/ListItemButton";

const UsersAdministration = () => {
    const location = useLocation()
    const [usersList, setUsersList] = useState<any[]>(['utente1', 'utente2', 'utente3', 'utente4', 'utente5', 'utente6', 'utente7', 'utente3', 'utente4', 'utente5', 'utente6', 'utente7','utente1', 'utente2', 'utente3', 'utente4', 'utente5', 'utente6', 'utente7', 'utente3', 'utente4', 'utente5'])

    const token = location.state?.token
    const isAdmin = location.state?.isAdmin
    if (token === undefined || isAdmin === undefined) {
        console.log('non sei loggato')
        return <Navigate to='/'/>
    }
    if(!isAdmin){
        console.log('non sei admin')
        return <Navigate to='/'/>
    }

    const handleOperation = () => {
        console.log('GESTISCO UTENTI')
    }

    return (
        <>
            <Grid container spacing={2} justifyContent="center" alignItems="center">
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
                    <Typography style={{color: 'white', textAlign: 'center', fontSize: '3rem'}}>Amministrazione utenti</Typography>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent="center"  sx={{marginTop: '55px'}}>
                    <List sx={{
                        width: '90%',
                        position: 'relative',
                        overflow: 'auto',
                        height: '200',
                    }}>
                        {usersList.map((value, index) => {
                            return (
                                <ListItem key={index}>
                                    <ListItemButton> {value}</ListItemButton>
                                </ListItem>
                            );
                        })}

                    </List>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent="center">
                    <Button style={{
                        marginTop: '15px',
                        borderRadius: 35,
                        backgroundColor: "#92d36e",
                        padding: "18px 36px",
                        fontSize: "15px"
                    }}
                            variant="contained"
                            onClick={() => {
                                handleOperation();
                            }}>
                        {'gestisci utente'}
                    </Button>
                </Grid>
            </Grid>
        </>
    );
}

export default UsersAdministration;
